const PremiumSingleCard = () => {
    return(
        <>
        <ul>
            <li className="premium-cards-list">
                <div className="premium-card-box">
                    <div className="premium-card-heading nextart-400" style={{color: "#66D9A2"}}>3 Месяца</div>
                    <div className="premium-card-price nextart-400" >169 руб/мес</div>
                    <button className="premium-btn-hover color-5"><span className="manrope-100">507руб</span>  |</button>
                </div>
            </li>
        </ul>
        </>
    )
}

export default PremiumSingleCard;
